import React from "react";
import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import PlaneComponent from "./components/PlaneComponent";
import IP_PlaneComponent from "./components/IP_PlaneComponent";
import IP_SpainComponent from "./components/IP_SpainComponent";
import IP_PortugalComponent from "./components/IP_PortugalComponent";
import IP_OverComponent from "./components/IP_OverComponent";
import IP_EntryComponent from "./components/IP_EntryComponent";

class App extends React.Component {
  render() {
    return (
    <Router>
        <div>

        <h2>Welcome to React Router Tutorial</h2>
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <ul className="navbar-nav mr-auto">
            <li><Link to={'/planes'} className="nav-link"> ALL </Link></li>
            <li><Link to={'/planes/ip'} className="nav-link">IP</Link></li>
            <li><Link to={'/planes/ip/portugal'} className="nav-link">PORTUGAL</Link></li>
            <li><Link to={'/planes/ip/spain'} className="nav-link">SPAIN</Link></li>
            <li><Link to={'/planes/ip/over'} className="nav-link">OVER</Link></li>
            <li><Link to={'/planes/ip/entry'} className="nav-link">ENTRY</Link></li>
          </ul>
          </nav>
          <hr />
          <Switch>
              <Route exact path='/planes' component={PlaneComponent} />
              <Route path='/planes/ip' component={IP_PlaneComponent} />
              <Route path='/planes/ip/spain' component={IP_SpainComponent} />
              <Route path='/planes/ip/portugal' component={IP_PortugalComponent} />
              <Route path='/planes/ip/over' component={IP_OverComponent} />
              <Route path='/planes/ip/entry' component={IP_EntryComponent} />

          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
